// Dummy list of users for the admin panel.  In a real app this data
// would come from an API.
const users = [
  { id: 1, name: 'Alice Johnson', email: 'alice@example.com', role: 'student', status: 'active' },
  { id: 2, name: 'Bob Smith', email: 'bob@example.com', role: 'trainer', status: 'active' },
  { id: 3, name: 'Carol Williams', email: 'carol@example.com', role: 'student', status: 'inactive' },
  { id: 4, name: 'Dave Wilson', email: 'dave@example.com', role: 'trainer', status: 'active' },
  { id: 5, name: 'Eve Davis', email: 'eve@example.com', role: 'admin', status: 'active' }
];

export default users;
